import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import Post from "@/components/Post"

import { waynedahlberg } from "@/authors";
export { getStaticProps } from "@/getStaticProps";
export const meta = {
  title: `End of year Update`,
  description: `A lot has happened`,
  date: "2016-12-27T14:24:00.000Z",
  authors: [waynedahlberg],
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = (props) => <Post meta={meta} {...props} />
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <p>{`Waiting for parts is the name of the game at this point. Critical parts suppliers are hit and miss. I’ve been attached to the Tapatalk mobile app to keep tabs on parts runs and availability countdowns.`}</p>
    <p>{`So far so good. I’ve managed to secure the CS:R aluminum legs from WorrParts, along with the matching diet horseshoes and shims that mount to the upper portion of the outside legs. The booster covers came in from IA Parts, and man they are slick. Off to a good start on the legs. Over the next few months I’ll try to pick up the leg struts, shoulder buttons, and under shoulder details. Relatively smaller parts, but no less expensive for their size.`}</p>
    <p>{`Still need to find all three ankles and all three feet.`}</p>
    <p>{`Mounted some of the HP’s with painters tape just to get an idea of how it’s going to look once the parts are attached. Also tried out my first dome drilling and use of the captive studs. Seems pretty straight forward, however, I didn’t like how the captive studs are a little visible even with the outer dome placed on top. Hmm. Will have to do more research.`}</p>
    <img src={image1} alt="july update" />
    <img src={image2} alt="july update" />
    <img src={image3} alt="july update" />
    <img src={image4} alt="july update" />
    <img src={image5} alt="july update" />

    </MDXLayout>;
}

